// src/components/SalesReport/SalesReport.jsx
import React, { useState, useEffect } from "react";
import ApexCharts from "apexcharts";
import { Table, Form, Button, Row,FormSelect } from "react-bootstrap";
import mockSalesData from "../../mockSalesData";

const SalesReport = () => {
    const [data, setData] = useState(mockSalesData);
    const [filter, setFilter] = useState({
        orderNumber: "",
        productName: "",
        productCategory: ""
    });

    const handleFilterChange = (e) => {
        const { name, value } = e.target;
        setFilter({ ...filter, [name]: value });
    };

    const handleClearFilters = () => {
        setFilter({ orderNumber: "", productName: "", productCategory: "" });
    };

    const filteredData = data.filter((item) => {
        return (
            (filter.orderNumber === "" || item.orderNumber.toString().includes(filter.orderNumber)) &&
            (filter.productName === "" || item.productName.toLowerCase().includes(filter.productName.toLowerCase())) &&
            (filter.productCategory === "" || item.productCategory.toLowerCase().includes(filter.productCategory.toLowerCase()))
        );
    });

    const chartData = {
        series: Object.values(
            filteredData.reduce((acc, item) => {
                acc[item.productCategory] = (acc[item.productCategory] || 0) + item.quantity;
                return acc;
            }, {})
        ),
        options: {
            chart: {
                type: "donut"
            },
            labels: Object.keys(
                filteredData.reduce((acc, item) => {
                    acc[item.productCategory] = true;
                    return acc;
                }, {})
            )
        }
    };

    return (
        <div className="container mt-5">
            <h1>Sales Report</h1>
            <div className="row mb-3">
                <div className="col">
                    <input
                        type="text"
                        name="orderNumber"
                        className="form-control"
                        placeholder="Filter by Order Number"
                        value={filter.orderNumber}
                        onChange={handleFilterChange}
                    />
                </div>
                <div className="col">
                    <input
                        type="text"
                        name="productName"
                        className="form-control"
                        placeholder="Filter by Product Name"
                        value={filter.productName}
                        onChange={handleFilterChange}
                    />
                </div>
                <div className="col">
                    <input
                        type="text"
                        name="productCategory"
                        className="form-control"
                        placeholder="Filter by Product Category"
                        value={filter.productCategory}
                        onChange={handleFilterChange}
                    />
                </div>
                <div className="col">
                    <button className="btn btn-secondary" onClick={handleClearFilters}>Clear Filters</button>
                </div>
            </div>
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>Order Number</th>
                        <th>Quantity</th>
                        <th>Product Name</th>
                        <th>Product Category</th>
                    </tr>
                </thead>
                <tbody>
                    {filteredData.map((item) => (
                        <tr key={item.orderNumber}>
                            <td>{item.orderNumber}</td>
                            <td>{item.quantity}</td>
                            <td>{item.productName}</td>
                            <td>{item.productCategory}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <div>
                <ApexCharts
                    options={chartData.options}
                    series={chartData.series}
                    type="donut"
                    width="500"
                />
            </div>
        </div>
    );
};

export default SalesReport;
